import React, { useState } from "react";

const ModelsPage = () => {
  const [formData, setFormData] = useState({
    state: "",
    district: "",
    season: "",
    crop: "",
    production: "",
    zn: "",
    fe: "",
  });
  const [loading, setLoading] = useState(false);
  const [prediction, setPrediction] = useState(null);
  const [error, setError] = useState(null);

  // Handle form input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Submit form to Flask server
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPrediction(null);
    setError(null);

    try {
      const response = await fetch("http://localhost:5000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      const data = await response.json();

      if (response.ok) {
        setPrediction(data);
      } else {
        setError(data.error || "Prediction failed.");
      }
    } catch (err) {
      setError("Server not reachable.");
    }

    setLoading(false);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-900 via-indigo-900 to-slate-900 p-6">
      <div className="max-w-3xl mx-auto bg-white/10 backdrop-blur-lg rounded-2xl p-8 border border-white/20">
        <h1 className="text-3xl font-bold text-white mb-6 text-center">
          Crop Price Prediction
        </h1>

        <form onSubmit={handleSubmit} className="space-y-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <input
              type="text"
              name="state"
              placeholder="State"
              value={formData.state}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
            <input
              type="text"
              name="district"
              placeholder="District"
              value={formData.district}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
            <input
              type="text"
              name="season"
              placeholder="Season"
              value={formData.season}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
            <input
              type="text"
              name="crop"
              placeholder="Crop"
              value={formData.crop}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
            <input
              type="number"
              name="production"
              placeholder="Production (tonnes)"
              value={formData.production}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
            <input
              type="number"
              name="zn"
              placeholder="Zinc (Zn)"
              value={formData.zn}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
            <input
              type="number"
              name="fe"
              placeholder="Iron (Fe)"
              value={formData.fe}
              onChange={handleChange}
              className="p-3 rounded-lg w-full text-black"
              required
            />
          </div>

          <button
            type="submit"
            className="w-full bg-purple-600 hover:bg-purple-700 text-white py-3 rounded-lg font-bold transition-colors duration-300"
          >
            {loading ? "Predicting..." : "Predict Price"}
          </button>
        </form>

        {prediction && (
          <div className="mt-6 bg-white/20 backdrop-blur-lg p-4 rounded-lg border border-white/20 text-white">
            <h2 className="text-xl font-bold mb-2">Prediction Result:</h2>
            <p>💰 ₹{prediction.predicted_price_quintal} per Quintal</p>
            <p>💰 ₹{prediction.predicted_price_tonne} per Tonne</p>
          </div>
        )}

        {error && (
          <div className="mt-6 text-red-400 font-bold">{error}</div>
        )}
      </div>
    </div>
  );
};

export default ModelsPage;
